import React from 'react';

function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.img} alt={props.alt}></img>
      <p>{props.phone}</p>
      <p>{props.email}</p>
    </div>
  );
}

function App() {
  return (
    <div>
      <h1 className='heading'>My Contacts</h1>
      <Card />
    </div>
  );
}

export default App;
